class UnionFindNode(object):
    def __init__(self, val):
        self.val = val
        self.parent = None
        self.children = []

class Solution(object):
    def __init__(self):
        self.UFTRoots = set()
        self.RootHash = {}

    def findFromRootHash(self, val):
        return self.RootHash[val]

    def find(self,root, val):
        if root.val == val:
            return True
        else:
            for c in root.children:
                exists = self.find(c, val)
                if exists:
                    return True
        return False

    def findFromRootSet(self,val):
        for n in self.UFTRoots:
            exists = self.find(n, val)
            if exists:
                return n
        return None

    def updateRootHash(self, from_node, to_node):
        self.RootHash[from_node.val] = to_node
        for c in from_node.children:
            self.updateRootHash(c, to_node)

    def reduceSet(self,c):
        root1 = self.findFromRootHash(c[0])
        root2 = self.findFromRootHash(c[1])
        if root1.val == root2.val:
            return
        elif root1.val > root2.val:
            root1.children.append(root2)
            self.updateRootHash(root2, root1)
            if root2 in self.UFTRoots:
                self.UFTRoots.remove(root2)
        else:
            root2.children.append(root1)
            self.updateRootHash(root1, root2)
            if root1 in self.UFTRoots:
                self.UFTRoots.remove(root1)

    def makeConnected(self, n, connections):
        if len(connections) < n-1:
            return -1

        for i in range(n):
            node = UnionFindNode(i)
            self.UFTRoots.add(node)
            self.RootHash[i] = node
        
        while True:
            set_length = len(self.UFTRoots)
            for c in connections:
                self.reduceSet(c)
            reduced_set_lenght = len(self.UFTRoots)
            if set_length == reduced_set_lenght:
                break
        return len(self.UFTRoots) - 1

